import styles from "./App.module.css";

function App() {
  return (
    <div className={styles.mainContainer}>
      <div className={styles.nav}>
        <p>Voting Poll Application</p>
        <p>Welcome, Jabez</p>
      </div>
      <div className={styles.componentContainer}></div>
    </div>
  );
}

export default App;
